import { moduleMetadata } from '@storybook/angular';
import { AppComponent } from './app.component';
export default {
    title: 'AppComponent',
    component: AppComponent,
    decorators: [
        moduleMetadata({
            imports: [],
        }),
    ],
};
const Template = (args) => ({
    props: args,
});
export const Primary = Template.bind({});
Primary.args = {};
